import React from 'react';
import { NavLink } from 'react-router-dom';
import UserService from '../service/UserService';

function Navbar() {
    const isAuthenticated = UserService.isAuthenticated();
    const isAdmin = UserService.isAdmin();

    const handleLogout = () => {
        const confirmDelete = window.confirm('Are you sure you want to logout this user?');
        if (confirmDelete) {
            UserService.logout();
        }
    };

    return (
        <nav>
            <div className="navbar-logo"></div> {/* Logo container */}
            <ul>
                {!isAuthenticated && <li><NavLink exact to="/" activeClassName="active-link">Login</NavLink></li>}
                {!isAuthenticated && <li><NavLink to="/register" activeClassName="active-link">Register</NavLink></li>}
                {isAuthenticated && <li><NavLink to="/profile" activeClassName="active-link">Profile</NavLink></li>}
                {isAuthenticated && <li><NavLink to="/files" activeClassName="active-link">File</NavLink></li>}
                {isAuthenticated && <li><NavLink to="/upload-file" activeClassName="active-link">UploadFile</NavLink></li>}
                {isAdmin && <li><NavLink to="/admin/user-management" activeClassName="active-link">User Management</NavLink></li>}
                {isAdmin && <li><NavLink to="/admin/subject-management" activeClassName="active-link">Subject Management</NavLink></li>}
                {isAuthenticated && <li><NavLink exact to="/" onClick={handleLogout}>Logout</NavLink></li>}
            </ul>
        </nav>
    );
}

export default Navbar;
